INSERT INTO `feedback_comment` VALUES (2,'','','','',11),(3,'','','','',93),(4,'','','','',94),(5,'','','','',95),(6,'','','','',96),(7,'','','','',93),(8,'','','','',94),(9,'','','','',95),(10,'','','','',101),(11,'','','','',98),(12,'','','','',100),(13,'','','','',94),(14,'','','','',93),(15,'','','','',98),(16,'','','','',96),(17,'','','','',101),(18,'','','','',95),(19,'','','','',98),(20,'','','','',100),(21,'','','','',101),(22,'','','','',100),(23,'','','','',96),(24,'','','','',93),(25,'','','','',94),(26,'','','','',95),(27,'','','','',96),(28,'','','','',98),(29,'','','','',100),(30,'','','','',101),(31,'','','','',93),(32,'','','','',93),(33,'','','','',94),(34,'The course is very important for computer science students but the teacher is not up to the mark.','He just sits in the class and dont even care to touch the board.','I am sorry to say this but Sir is unable to clear doubts of students.When asked by students he says to do it as home-work or read from books.','',95),(35,'','','','I am sorry to say this but being a teacher of Data Structures and Algorithm our teacher is unable to preform relative grading in the exams.For the past two semesters he has been fooling students by saying that his relative grading graph always matches with the absolute grading range.',96),(36,'No course taught at all!! How can it be organised then? ','Nothing taught!','Nothing taught! So no interaction.. Go to class sit there until its past 50 mins when he goes.','Copies were not even checked. Marks were written just seeing the handwriting and umber of pages infront of the students themselves .',93),(37,'','','','',98),(38,'Most of the syllabus( around 30%) is covered (mostly skipped by writing topics) in the last 2-3 lectures! Very slow during first few lectures. Bad organisation','Unable to explain  things. Gets stuck in middle.','Many topics are taught wrong. When questioned ,we are asked to read it ourselves at room.','The toughness of exams is good. Grading is improp